  `created_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`rating_id`),
  KEY `scheduleID` (`schedule_id`),
  KEY `criteriaID` (`criterion_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `ratings_ibfk_2` FOREIGN KEY (`criterion_id`) REFERENCES `criteria` (`criterion_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `ratings_ibfk_4` FOREIGN KEY (`schedule_id`) REFERENCES `schedules` (`schedule_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `ratings_ibfk_5` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=11267 DEFAULT CHARSET=latin1;

